import React from 'react'
import Map from './Map'

const Main = () => {

    const shipPositions = [
        {positionX: 51.505, positionY: -0.09},
        {positionX: 52.505, positionY: -0.09},
        {positionX: 51.700, positionY: -0.09},
        {positionX: 50.505, positionY: -0.09},
    ]

    return(
        <Map shipPositions={shipPositions}></Map>
    )
}

export default Main;
